;; **
;;; The above (homomorphic) matching semantics is the default. However, matching multiple nodes in a rule to a single node in the graph may not be desirable in some appliations. In this case, the rule designer can specify the rule to enforce **_isomorphic_** matching. The following rule is `rel2` identical to the above rule `rel`, except that it requires _isomorphic_ matches.
;; **

;; @@
(rule 'rel2 
   :read 	(pattern :iso
             (node 'h :label "Hello")
             (node 'h2 :label "Hello"))
   :create	(pattern 
             (edge :src 'h :tar 'h2 :label "rel")))
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"227\" height=\"251\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x44c94b59 \"BufferedImage@44c94b59: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@38500bee transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 227 height = 251 #numDataElements 4 dataOff[0] = 3\"]"}
