;; **
;;; 
;;; ## 4.2 Non-determinism during matching
;;; 
;;; Consider the above example of graph `g2` again. Is there only one possible way to apply rule `rel2`? Indeed, there are **two** possible ways to apply that rule. The rules of the two nodes could also have been reverse, which would create the relationship in the opposite direction. 
;;; 
;;; _Applying a rule to a graph non-deterministically picks one out of possibly many valid matches._
;;; 
;;; ## 4.3 Starred rule applications
;;; 
;;; In addition to simple rule applications, which non-deterministically pick one out of possibly many matches, @@GrapeVine@@ provides __starred rule applications__. A starred rule application applies a rule so that all possible matches are performed. This generates a set of graphs, where each graph represents the result of a possibel rule application. The output is a Grape, which contains more than a single graph. (See Section 2.1)
;;; 
;;; Invoking a starred rule is simply done by adding an asterisk after the rules name:
;; **

;; @@
(rel2* g2)
;; @@
;; =>
