;; **
;;; ## 4.3 Applying rules to Grapes
;;; 
;;; So far, we only applied rules to single graphs, i.e., Grapes with a single element. However, rules can also be applied to Grapes that enumerate multiple graphs. Consider the Grape produced by the following statement. (We create a graph with two `Hello` nodes and then carry out a starred rule application of `world`.) The Grape should have two graphs: 
;; **

;; @@
(-> (newgrape) hello hello world*)
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[{"type":"html","content":"<span class='clj-string'>&quot;042e55a5-bf35-456b-b2e4-f3a1ff69c28b&quot;</span>","value":"\"042e55a5-bf35-456b-b2e4-f3a1ff69c28b\""},{"type":"html","content":"<span class='clj-string'>&quot;f5e0578e-4428-4e72-9264-0eced6345e5b&quot;</span>","value":"\"f5e0578e-4428-4e72-9264-0eced6345e5b\""}],"value":"(\"042e55a5-bf35-456b-b2e4-f3a1ff69c28b\" \"f5e0578e-4428-4e72-9264-0eced6345e5b\")"}
