;;; As explained above, rules are applied to graphs (Grapes) and are used to derive new graphs. This _derivation process_ is called a **graph process** where the nodes represent graphs and the edges represent **occurrences** of graph productions (rule applications).
;;; 
;;; For any graph, we can visualize the graph process it participates in with the `viewproc` form:
;; **

;; @@
 (-> (newgrape) hello hello world* vine viewproc)
