;; **
;;; ### 7.1.1 Rolling back uninteresting derivations
;;; We may want to roll back uninteresting graph derivations, for example to free up resources or to prune graph processes. We can do so by using the `rollback` form. **Warning**: calling rollback will remove _all_ graphs that are not in the history of any _committed_ (tagged) graph.
;;; 
;;; The following example illustrates this behaviour. In the code block below, we create a graph process with four different branches, originating from the same empty start graph. We commit a tag for the end-result of one of these derivations.
;; **

;; @@
(def start (newgrape))

(-> start hello world vine)
(-> start hello world vine)
(-> start hello world vine)
(-> start hello world vine)
(commit _ "my graph")
(viewproc start)
