;; <=

;; @@
(loop [g (-> (newgrape) setup-ferryman)]
  (let [gn (-> g
            (choice ferry_one_over* cross_empty*)
            wolf-can-eat-goat?-
            goat-can-eat-grape?-)]
    (if (empty? (all_on_the_other_side? gn))
      (recur gn)
      (all_on_the_other_side? gn))))

